import { Link } from 'react-router-dom';
import { Table } from '../components/table';

export const ListUsers = () => {
    return (
        <div className="row mt-5">
            <h1>List User</h1>
            <hr />
            <Table />


            <Link to='../user'>
                <div className="d-grid gap-2">
                    <button type="button" className='btn btn-primary'> Add User</button>    
                </div>
            </Link>


        </div>
    )
}
